import React from 'react';

const SearchBar = ({ onSearch }) => {
  return (
    <div style={{ display: 'flex', justifyContent: 'center' }}>
      <input
        type="search"
        placeholder="지금 새로운 모임을 찾아보세요!"
        onChange={onSearch}
        style={{ width: '500%', padding: '10px', margin: '10px 0' }}
      />
    </div>
  );
};

export default SearchBar;
